import { useState } from 'react';
import { Link } from 'react-router-dom';
import '../App.css';

function homepage() {
  return (
    <div>
      <div className="content">
        <h2>Welcome to My Website!</h2>
        <p>This is the home page content.</p>
      </div>
    </div>
  );
}

export default homepage;
